/**
*
* 용도 : 상세코드의 코드명을 반환
* 사용법 : SELECT DBO.FN_CODE_DETAIL_NM('HIST04')
* 작성자 : 기술연구소 선임 김태용
* 작성일시 : 2018-01-04
*
*/

CREATE FUNCTION [dbo].[FN_CODE_DETAIL_NM] (@STR1 NVARCHAR(MAX))
RETURNS NVARCHAR(MAX)
BEGIN

   DECLARE @RETURN_VAL NVARCHAR(MAX);

   SET @RETURN_VAL = (SELECT TOP 1 CODE_NM AS RETURN_VAL FROM COMTCCMMNDETAILCODE WHERE CODE = @STR1)

   RETURN @RETURN_VAL;
END;



