/****** Object:  UserDefinedFunction [dbo].[StripHTML]    Script Date: 2018-04-10 오전 10:30:37 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE FUNCTION     [dbo].[StripHTML]   
        (  
            @iHTMLText          VARCHAR(MAX),  
            @iIncludeNewLine    VARCHAR(1)      = '0'  
        )  
RETURNS     VARCHAR(MAX)   
AS  
BEGIN  
  
    DECLARE @Start INT  
    DECLARE @End INT  
    DECLARE @Length INT  
      
    -- NON 꺽쇠괄호 처리  
    SELECT  @iHTMLText  = REPLACE(@iHTMLText,'<','<')  
    SELECT  @iHTMLText  = REPLACE(@iHTMLText,'>','>')  
    SELECT  @iHTMLText  = REPLACE(@iHTMLText,'&','&')  
    SELECT  @iHTMLText  = REPLACE(@iHTMLText,' ',' ')    
      
    -- <br> ==> 엔터키로 변경, default : 변경안함  
    IF  @iIncludeNewLine    = '1'  
    BEGIN  
        SELECT  @iHTMLText  = REPLACE(@iHTMLText,'<br>',CHAR(13) + CHAR(10))  
        SELECT  @iHTMLText  = REPLACE(@iHTMLText,'<br/>',CHAR(13) + CHAR(10))  
        SELECT  @iHTMLText  = REPLACE(@iHTMLText,'<br />',CHAR(13) + CHAR(10))  
    END  
          
        
    SET @Start = CHARINDEX('<',@iHTMLText)  
    SET @End = CHARINDEX('>',@iHTMLText,CHARINDEX('<',@iHTMLText))  
    SET @Length = (@End - @Start) + 1  
      
    WHILE @Start > 0 AND @End > 0 AND @Length > 0  
    BEGIN  
        SET @iHTMLText = STUFF(@iHTMLText,@Start,@Length,'')  
        SET @Start = CHARINDEX('<',@iHTMLText)  
        SET @End = CHARINDEX('>',@iHTMLText,CHARINDEX('<',@iHTMLText))  
        SET @Length = (@End - @Start) + 1  
    END  
      
      
    RETURN (LTRIM(RTRIM(@iHTMLText)))  
      
END
GO

